import * as React from 'react';
import {StrictMode} from 'react';

export default function PartiallyStrictApp(): React.Node {
  return (
    <>
      <Child />
      <StrictMode>
        <StrictChild />
      </StrictMode>
    </>
  );
}

function Child() {
  return <Grandchild />;
}

function StrictChild() {
  return <Grandchild />;
}

function Grandchild() {
  return null;
}








































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































